*/
@import url(~lightbox2/dist/css/lightbox.css);
@import url(~jquery-ui/themes/base/core.css);
@import url(~jquery-ui/themes/base/theme.css);
@import url(~jquery-ui/themes/base/tooltip.css);
@import url(~jquery-ui/themes/base/datepicker.css);
@import url(~jquery-ui/themes/base/slider.css);
@import url(~jquery-ui-timepicker-addon/src/jquery-ui-timepicker-addon.css);
@import url(~jgallery/dist/css/jgallery.css);
html, body, div, span, applet, object, iframe,
h1, h2, h3, h4, h5, h6, p, blockquote, pre,
a, abbr, acronym, address, big, cite, code,
del, dfn, em, img, ins, kbd, q, s, samp,
small, strike, strong, sub, sup, tt, var,
b, u, i, center,
dl, dt, dd, ol, ul, li,
fieldset, form, label, legend,
table, caption, tbody, tfoot, thead, tr, th, td,
article, aside, canvas, details, embed,
figure, figcaption, footer, header, hgroup,
menu, nav, output, ruby, section, summary,
time, mark, audio, video {
  margin: 0;
  padding: 0;
  border: 0;
  font-size: 100%;
  font: inherit;
  vertical-align: baseline;
}

/* HTML5 display-role reset for older browsers */
article, aside, details, figcaption, figure,
footer, header, hgroup, menu, nav, section, main {
  display: block;
}

body {
  line-height: 1;
}

ol, ul {
  list-style: none;
}

blockquote, q {
  quotes: none;
}

blockquote:before, blockquote:after,
q:before, q:after {
  content: '';
  content: none;
}

table {
  border-collapse: collapse;
  border-spacing: 0;
}

/* borders vallen hiermee binnen afmetingen van een element:
*/
*, *::after, *::before {
  -webkit-box-sizing: border-box;
  -moz-box-sizing: border-box;
  box-sizing: border-box;
}

@keyframes rotate {
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(360deg);
  }
}

.ico {
  display: inline-block;
  overflow: hidden;
  background: url("../images/icons.png") no-repeat;
  width: 16px;
  height: 16px;
  vertical-align: middle;
}

.ico.text {
  margin: 3px;
  vertical-align: bottom;
}

.ico.rotating,
.dt-button-ico.rotating span::before {
  animation-name: rotate;
  animation-duration: 1s;
  animation-iteration-count: infinite;
  animation-timing-function: linear;
}

.dt-button-ico span::before {
  content: '';
  margin: -2px 5px -2px -1px;
  display: inline-block;
  overflow: hidden;
  background: url("../images/icons.png") no-repeat;
  width: 16px;
  height: 16px;
  vertical-align: middle;
}

.ico.rotate-90 {
  transform: rotate(90deg);
}

.ico.rotate-180 {
  transform: rotate(180deg);
}

.ico.rotate-270 {
  transform: rotate(270deg);
}

.ico.flip-horizontal {
  transform: scale(-1, 1);
}

.ico.flip-vertical {
  transform: scale(1, -1);
}

